#include "pdc.h"


double pdc_t::symmetricAlphaDivergence( const std::vector<double> & x , const std::vector<double> & y )
{
  
  const int n = x.size();

  if ( y.size() != n ) 
    Helper::halt( "internal error in pdc_t::symmetricAlphaDivergence()" );
  
  double retval = 0;
  
  for (int i=0;i<n;i++)
    retval += sqrt( x[i] * y[i] );
  
  retval = 4 * ( 1- retval );
  
  return retval;
}



double pdc_t::squared_hellinger( const std::vector<double> & x , const std::vector<double> & y )
{
  
  const int n = x.size();
  
  if ( y.size() != n ) Helper::halt( "internal error in pdc_t::squared_hellinger()" );

  double retval = 0;
  
  for (int i=0;i<n;i++)
    {
      double t = sqrt(x[i]) - sqrt( y[i] );
      retval += t*t;
    }

  return 0.5 * retval;

}



double pdc_t::hellinger( const std::vector<double> & x , const std::vector<double> & y )
{
  //return( 1/(sqrt(2))* sqrt( sum( (sqrt(x)-sqrt(y))**2 ) ))

  if ( x.size() != y.size() ) Helper::halt( "internal error in pdc_t::hellinger()" );

  double retval = 0 ; 

  const int n = x.size();

  for (int i = 0 ; i < n ; i++ )
    {
      double t = sqrt( x[i] ) - sqrt( y[i] ) ;
      retval += t*t;
    }
  
  return  1/sqrt(2.0) * sqrt( retval );
  
}

  
double pdc_t::entropy( const std::vector<double> & x )
{
  
  double e = 0;

  const int n = x.size();
  int n1 = 0;

  for ( int i = 0 ; i < n ; i++ )
    {
      if ( x[i] != 0 ) 
	{
	  e -= x[i] * log( x[i] ) ;
	  ++n1;
	}
    }
  
  if ( n1 > 0 ) e /= log( n1 );
  
  return e;
}






