int pdc_t::num_pd(int m) 
{
  if ( m == 1 ) return 0;
  if ( m == 2 ) return 2;
  if ( m == 3 ) return 6;
  if ( m == 4 ) return 24;
  if ( m == 5 ) return 120;
  if ( m == 6 ) return 720;
  if ( m == 7 ) return 5040;
  return -1;
}



